import React from "react";
import Navbar from "../Navbar";
import Searchbar from "./Searchbar";
import CrecheSlider1 from "./CrecheSlider1";
import Searchbar2 from "./Searchbar2";

const Search = () => {
  return (
    <>
      <div>
        <Navbar />
      </div>
      <div>
        <Searchbar />
        <Searchbar2/>
        <div className=" max-w-[700px] "> 
        <CrecheSlider1 />
        </div>
        <CrecheSlider1 />
      </div>
    </>
  );
};

export default Search;
